import React from 'react';

function PC() {
  return (
    <div>
      <h1>Logged into the PC</h1>
      <h2>
        <a href='/storage'>View storage</a>
        <br />
        <a href='/storage/party'>View Party</a>
        <a href='/storage/gift'>Receive gift</a>
      </h2>
    </div>
  );
}

export default PC;

